if(logOut){
    logOut.addEventListener("click", e => {
        logout();
    })
}

if(divisor){
    divisor.addEventListener("click", e => {
        if(e.target.matches("#EliminarInforme, #EliminarInforme *")){
            const id = e.target.parentElement.parentElement.dataset.id;
